import React from "react";
import "./App.css";
import {HashRouter, Route} from "react-router-dom";
import Table from "./components/Table";
import {url} from "inspector";

function App() {
  return (
    <div className="App">
      <HashRouter>
        <div>
          <Route exact path="/*" component={props => <Table props={url} />} />
        </div>
      </HashRouter>
    </div>
  );
}

export default App;
